import { AppBar, Toolbar, Typography } from "@material-ui/core";

function App() {
  return (
    <div className="App">
      <AppBar position='static'>
        <Toolbar color="purple">
          <Typography>React Navbar Example</Typography>
        </Toolbar>
      </AppBar>
    </div>
  );
}

export default App;
